    data: |
      SELECT DISTINCT + - 60 + + cor0.col0 / - cor0.col2 AS col1 FROM tab0 (FORMAT parquet), tab0 (FORMAT parquet) cor0;
  - name: tab0

outputs:
  - name: q4925.out
    data: |
      -60
      -61
      -95
